create  database  if not exists filmclub;
use filmclub;

CREATE TABLE besuch (
  VeranstaltungID int(5) unsigned NOT NULL default '0',
  MitgliedID int(5) unsigned NOT NULL default '0',
  PRIMARY KEY  (VeranstaltungID,MitgliedID),
  UNIQUE KEY VeranstaltungID (VeranstaltungID,MitgliedID)
) ;







CREATE TABLE film (
  FilmID int(5) unsigned NOT NULL auto_increment,
  Titel varchar(50) NOT NULL default '0',
  Format varchar(10) default '0',
  Regie varchar(20) default '0',
  Erscheinungsjahr int(4) unsigned default '0',
  Länge int(3) unsigned default '0',
  Verleih varchar(30) default NULL,
  PRIMARY KEY  (FilmID),
  UNIQUE KEY FilmID (FilmID)
);






CREATE TABLE mitglied (
  PersID int(11) NOT NULL auto_increment,
  Vorname varchar(30) NOT NULL default '',
  Name varchar(30) NOT NULL default '',
  Strasse varchar(30) default NULL,
  Ort varchar(30) default NULL,
  Anrede varchar(10) default NULL,
  Privattelefon varchar(20) default NULL,
  Eingabedatum datetime default NULL,
  PRIMARY KEY  (PersID)
);





CREATE TABLE raum (
  RaumID int(3) unsigned NOT NULL auto_increment,
  Bezeichnung varchar(30) NOT NULL default '0',
  Adresse varchar(30) NOT NULL default '0',
  Platzzahl int(3) unsigned NOT NULL default '0',
  PRIMARY KEY  (RaumID)
);







CREATE TABLE veranstaltung (
  VeranstaltungID int(5) NOT NULL auto_increment,
  FilmIDFS int(5) NOT NULL default '0',
  RaumIDFS int(5) NOT NULL default '0',
  Datum date NOT NULL default '0000-00-00',
  Zeit time NOT NULL default '00:00:00',
  Eintrittspreis decimal(10,0) NOT NULL default '0',
  PRIMARY KEY  (VeranstaltungID)
);







CREATE TABLE vorstandsmitglied (
  Entschädigung decimal(5,0) default '0',
  Funktion varchar(20) default '0',
  MitgliedID int(5) unsigned NOT NULL default '0',
  VorstandID int(5) unsigned NOT NULL default '0',
  PRIMARY KEY  (VorstandID),
  UNIQUE KEY MitgliedID (MitgliedID)
);




